@font-face {
font-family: antennacond-regular;
src: url("https://fonts.gstatic.com/s/roboto/v20/KFOlCnqEu92Fr1MmEU9fBBc4") format("woff2"),
	 url("https://fonts.gstatic.com/s/roboto/v20/KFOlCnqEu92Fr1MmSU5fBBc4") format("woff2"),
	 url("https://use.typekit.net/af/dc8fcf/00000000000000003b9ad458/27/a?primer=8c6cdece1802ac03951c30593622b1b6185a07621a4f8858e37fe29080c384e2&fvd=n4&v=3") format("opentype");
font-style: normal;
font-weight: 400;
} 

/*Override font-family, setting default font*/
body{
	font-family: antennacond-regular, Roboto, "Helvetica Neue", Arial, Helvetica, sans-serif, open-sans, Verdana;
	color: #12120d;
}

/*Override font-family, setting default font*/
.qv-object *{
	font-family: antennacond-regular, Roboto, Arial, Helvetica, sans-serif, open-sans, Verdana;
}

/*Sheet background*/
.qvt-sheet {
    background: #E4E4E4 !important;
}

/*Pyjamas tabell*/
.qv-object-table tr.qv-st-data-row:nth-child(even){
	background-color: #F5F5F5	!important;
}

